import React, { useEffect, useRef } from "react";

export const Navigation = () => {
  const menuRef = useRef(null);
  const navIconRef = useRef(null);
  const invisRef = useRef(null);

  useEffect(() => {
    const handleMenuClick = () => {
      const marginProp = window
        .getComputedStyle(menuRef.current)
        .getPropertyValue("margin-left");

      if (marginProp === "-300px") {
        menuRef.current.style.marginLeft = "0px";
        navIconRef.current.style.position = "fixed";
        invisRef.current.style.position = "relative";
      } else if (marginProp === "0px") {
        menuRef.current.style.marginLeft = "-300px";
        navIconRef.current.style.removeProperty("position");
        invisRef.current.style.position = "absolute";
      }
    };

    const handleMainClick = () => {
      const marginProp = window
        .getComputedStyle(menuRef.current)
        .getPropertyValue("margin-left");

      if (marginProp === "0px") {
        menuRef.current.style.marginLeft = "-300px";
        navIconRef.current.style.removeProperty("position");
        invisRef.current.style.position = "absolute";
      }
    };

    navIconRef.current.addEventListener("click", handleMenuClick);
    document.querySelector("main").addEventListener("click", handleMainClick);

    return () => {
      navIconRef.current.removeEventListener("click", handleMenuClick);
      document
        .querySelector("main")
        .removeEventListener("click", handleMainClick);
    };
  }, []);

  return (
    <>
      <section className="navigation-slider" ref={menuRef}>
        <section className="sign-in">
          <img
            className="profile-icon"
            src="/Images/Icons/profile-icon.png"
            alt="Sign in"
          />
          <a className="sign-in__link">Sign in</a>
        </section>
        <ul className="navigation-options">
          <li className="option">
            <a href="/home.html">
              <p>Home</p>
              <p>&#10095;</p>
            </a>
          </li>
          <li className="option">
            <a href="/products.html">
              <p>Cameras</p>
              <p>&#10095;</p>
            </a>
          </li>
          <li className="option">
            <a href="/products.html">
              <p>Lens</p>
              <p>&#10095;</p>
            </a>
          </li>
          <li className="option">
            <a href="/products.html">
              <p>Accessories</p>
              <p>&#10095;</p>
            </a>
          </li>
          <li className="option">
            {" "}
            <a href="/products.html">
              <p>Carrying Bags</p>
              <p>&#10095;</p>
            </a>
          </li>

          <li className="option">
            <a href="/products.html">
              <p>Tripods</p>
              <p>&#10095;</p>
            </a>
          </li>
          <li className="option">
            <a href="/products.html">
              <p>Sale</p>
              <p>&#10095;</p>
            </a>
          </li>
        </ul>
        <ul className="help-options">
          <li className="option">
            <a href="/contact.html">
              <p>Contact Us</p>
            </a>
          </li>
          <li className="option">
            <a href="/contact.html">
              <p>Newsletter</p>
            </a>
          </li>
          <li className="option">
            <a href="/contact.html">
              <p>Find a store</p>
            </a>
          </li>
          <li className="option">
            <a href="/contact.html">
              <p>Legal & Privacy</p>
            </a>
          </li>
        </ul>
      </section>
    </>
  );
};
